import React from 'react';
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';

import Logo from '../assets/images/alto-logo.png';


const NavBar = () => {

    const className= ['nav-container', 'sticky-top', 'w-100', 'shadow']
    return(
        <nav className={className.join(' ')}>
            <Link to="/home">
                <Logo/> 
            </Link>
        </nav>
    )
}

export default NavBar;
